import React, { useState } from 'react';
import { Layout, Menu, Button, Card, Input, Upload, Space, message, TimePicker, Form } from 'antd';
import { UploadOutlined, SendOutlined } from '@ant-design/icons';
import { useNavigate } from 'react-router-dom';
import moment from 'moment';
import './index.less';

const { Header, Content } = Layout;
const { TextArea } = Input;

const Home = () => {
  const [question, setQuestion] = useState('');
  const [form] = Form.useForm();
  const navigate = useNavigate();

  const handleSendQuestion = () => {
    if (!question.trim()) {
      message.warning('请输入问题');
      return;
    }
    // TODO: 发送问题到后端
    console.log('发送问题:', question);
  };

  const handleGeneratePlan = async () => {
    try {
      const values = await form.validateFields();
      const timeRanges = values.timeRanges.map(range => ({
        start: range[0].format('HH:mm'),
        end: range[1].format('HH:mm')
      }));
      
      // TODO: 发送到后端生成计划
      console.log('空闲时间段：', timeRanges);
      message.success('学习计划生成成功！即将跳转到学习计划页面...');
      setTimeout(() => navigate('/study-plan'), 1500);
    } catch (error) {
      message.error('请填写完整的时间段信息');
    }
  };

  return (
    <Layout className="home-layout">
      <Header className="header">
        <div className="logo">学习助手</div>
        <Menu mode="horizontal" theme="dark">
          <Menu.Item key="plan" onClick={() => navigate('/study-plan')}>学习计划</Menu.Item>
          <Menu.Item key="feedback" onClick={() => navigate('/feedback')}>反馈</Menu.Item>
          <Menu.Item key="user" onClick={() => navigate('/user')}>个人中心</Menu.Item>
        </Menu>
      </Header>

      <Content className="content">
        <Card title="AI 问答助手" className="qa-card">
          <div className="chat-container">
            {/* 这里可以添加聊天记录展示 */}
          </div>
          <div className="input-area">
            <TextArea
              value={question}
              onChange={(e) => setQuestion(e.target.value)}
              placeholder="请输入您的问题..."
              autoSize={{ minRows: 2, maxRows: 6 }}
            />
            <Space className="action-buttons">
              <Upload>
                <Button icon={<UploadOutlined />}>上传图片</Button>
              </Upload>
              <Button 
                type="primary" 
                icon={<SendOutlined />}
                onClick={handleSendQuestion}
              >
                发送
              </Button>
            </Space>
          </div>
        </Card>
        <Card title="学习计划生成" className="plan-card">
          <Form
            form={form}
            initialValues={{
              timeRanges: [
                [moment('07:00', 'HH:mm'), moment('21:00', 'HH:mm')]
              ]
            }}
          >
            <Form.List name="timeRanges">
              {(fields, { add, remove }) => (
                <>
                  {fields.map((field, index) => (
                    <Form.Item
                      required={false}
                      key={field.key}
                      label={index === 0 ? '空闲时间段' : ''}
                    >
                    </Form.Item>
                  ))}
                  <Form.Item>
                    <div className='bu'>
                      <Button type="dashed" onClick={() => add()} block>
                      添加空闲时间段
                    </Button>
                    </div>
                  </Form.Item>
                </>
              )}
            </Form.List>
            <Form.Item>
              <Button type="primary" onClick={handleGeneratePlan}>
                生成学习计划
              </Button>
            </Form.Item>
          </Form>
        </Card>

      </Content>
    </Layout>
  );
};

export default Home;
